import React from 'react';

const NewComponent = () => {

    const [name, setName] = React.useState('');


    return(
        <div>
            <h1>{name}</h1>
            <input
                type="text"
                value={name}
                onChange={event => setName(event.target.value)}
            />
        </div>
    )
}

export default NewComponent;
